  <CartItemContainer>
    <CartItemImage src={imageUrl} alt='item' />
    <ItemDetailContainer>
      <span>{name}</span>
      <span>
        {quantity} x Â£{price}
      </span>
    </ItemDetailContainer>
  </CartItemContainer>
);

